// Fungsi dekripsi
function decryptCode(encrypted, key, salt) {
    let withoutSalt = encrypted;
    if (salt) {
        withoutSalt = encrypted.substring(salt.length, encrypted.length - salt.length);
    }
    
    const reversed = withoutSalt.split('').reverse().join('');
    
    const reverseSubstitutionMap = {
        'Z': 'A', 'Y': 'B', 'X': 'C', 'W': 'D', 'V': 'E',
        'U': 'F', 'T': 'G', 'S': 'H', 'R': 'I', 'Q': 'J',
        'P': 'K', 'O': 'L', 'N': 'M', 'M': 'N', 'L': 'O',
        'K': 'P', 'J': 'Q', 'I': 'R', 'H': 'S', 'G': 'T',
        'F': 'U', 'E': 'V', 'D': 'W', 'C': 'X', 'B': 'Y',
        'A': 'Z',
        'z': 'a', 'y': 'b', 'x': 'c', 'w': 'd', 'v': 'e',
        'u': 'f', 't': 'g', 's': 'h', 'r': 'i', 'q': 'j',
        'p': 'k', 'o': 'l', 'n': 'm', 'm': 'n', 'l': 'o',
        'k': 'p', 'j': 'q', 'i': 'r', 'h': 's', 'g': 't',
        'f': 'u', 'e': 'v', 'd': 'w', 'c': 'x', 'b': 'y',
        'a': 'z',
        '9': '0', '8': '1', '7': '2', '6': '3', '5': '4',
        '4': '5', '3': '6', '2': '7', '1': '8', '0': '9',
        '-': '+', '_': '/', '.': '='
    };
    
    let desubstituted = "";
    for (let char of reversed) {
        desubstituted += reverseSubstitutionMap[char] || char;
    }
    
    const firstDecode = atob(desubstituted);
    
    let xorDecrypted = "";
    for (let i = 0; i < firstDecode.length; i++) {
        const keyChar = key.charCodeAt(i % key.length);
        const encodedChar = firstDecode.charCodeAt(i);
        xorDecrypted += String.fromCharCode(encodedChar ^ keyChar);
    }
    
    const finalDecoded = atob(xorDecrypted);
    
    return finalDecoded;
}

